import React, {useEffect} from "react"
import { Route, Routes } from "react-router-dom";
import { useState } from "react";





const Modal = ({setModal, setFormData, formData}) => {

    const handleModal = () => {
        
        setModal(false)
    }

    const handleChange = event => {
        setFormData(event.target.value)
    }
    
    
    return (
        <div className='backshadow'>
            <div className='custom-modal'>
                <div className="delete-icon"
                onClick={handleModal}>x</div>
                <div>
                    <button value="White" onClick={handleChange}>White</button>
                    <button value="Black" onClick={handleChange} >Black</button>
                    <button value="Gray" onClick={handleChange} >Gray</button>
                    <button value="Silver" onClick={handleChange} >Silver</button>
                    <button value="Blue" onClick={handleChange} >Blue</button>
                    <button value="Red" onClick={handleChange} >Red</button>
                    <button value="Green" onClick={handleChange} >Green</button>
                    <button value="Tan" onClick={handleChange} >Tan</button>
                    <button value="Brown" onClick={handleChange} >Brown</button>
                    <button value="Burgundy" onClick={handleChange} >Burgundy</button>
                    <button value="Purple" onClick={handleChange} >Purple</button>
                    <button value="Pink" onClick={handleChange} >Pink</button>
                    

                </div>
                 
                </div>  
                
        </div>
    )}
export default Modal;
